script: |
  super -f text -I q10950.spq | sort > q10950.out

inputs:
  - name: q10950.spq
    data: |
      SELECT + + ( - col2 ) * - col1 + + col2 + + col2 - col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 18 NOT BETWEEN - 66 + + 29 / - col1 AND 89;
  - name: tab0

outputs:
  - name: q10950.out
    data: |
      209
      296
      3820
